function migratoryBirds($arr) {
	// Calculate occurences
    $values = array_count_values($arr);
	// Reverse order (results are highest to lowest)
    arsort($values);
	// If only one key has the highest occurence, return it now
	if(array_count_values($values)[max($values)] === 1) {
		return key($values);
	}
	// There are more than one keys with the highest occurence, return the lowest value
	return min(array_keys($values, max($values)));
}

